import logo from './logo.svg';
import './App.css';
import Profile from "./Profile";
import Learn from "./Learn";
import Interests from "./Interests";
import Hobbies from "./Hobbies";
import Expectation from "./Expectation";

function App() {
  return (
    <div className="App">
      <Profile/>
      <Learn />
      <Interests />
      <Hobbies />
    </div>
  );
}

export default App;
